import React from "react";
import { Col, Container, Row } from "react-bootstrap";

const Project = () => {
  const projects = [
    { titel: "Prep 27", descripation: "Design and development", ImgUrl: "..." },
    { titel: "Prep 27", descripation: "Design and development", ImgUrl: "..." },
    { titel: "Prep 27", descripation: "Design and development", ImgUrl: "..." },
  ];
  return (
    <section className="project">
      <Container>
        <Row>
          <Col></Col>
        </Row>
      </Container>
    </section>
  );
};

export default Project;
